import "./Propss.css"

const Home=(props)=>{
    console.log(props);
return(
    <>
    <h1 style={text=left}>List of Top Movies in 2024</h1>

    <div className="hero1"> 
    <h1>{props.MName}</h1>
    <img src={props.MImg} alt="random"/>
    <h3>{props.MRating}</h3>
    <a href={props.MLink} target="_blank"><button>Download Movie</button>
    </a>
    </div>
    
    </>
)

}

export default Home;
